#include <stdio.h>

int main() {
    int N, M;
    scanf("%d", &N);
    int D[N];
    for (int i = 0; i < N; i++) {
        scanf("%d", &D[i]);
    }
    scanf("%d", &M);
    int T[M];
    for (int i = 0; i < M; i++) {
        scanf("%d", &T[i]);
    }

    int count[100001] = {0};
    for (int i = 0; i < N; i++) {
        count[D[i]]++;
    }

    int possible = 1;
    for (int i = 0; i < M; i++) {
        if (count[T[i]] > 0) {
            count[T[i]]--;
        } else {
            possible = 0;
            break;
        }
    }

    if (possible) {
        printf("YES\n");
    } else {
        printf("NO\n");
    }

    return 0;
}
